import React, {Component} from 'react'

class App extends Component{
    constructor(){
        super()
        this.state = {
            number: 0
        }

    }

    clickHandler(){
        console.log('test')
    }

    render(){
        return(
            <div className='container'>
            <h1>{this.state.number}</h1>
            <button onClick={this.clickHandler} class='btn btn-primary'>Click me</button>
            </div>
        )
    }
}

export default App
